import Content from "../Content/Content.js";
import Menu from "../Menu/Menu.js";
import Footer from "../Footer/Footer.js";
import BarraLateral from "../BarraLateral/BarraLateral.js";
import "./Home.css";

const Home = () => {
  return (
    <div className=" container ">
      <div></div>
      <Menu />

      <BarraLateral />
      <Content />
      <Footer />
    </div>
  );
};

export default Home;
